column8:
生体からも目立ちにくく、驚かせにくい、細いボディと黒い塗装のロングタイプのピンセットです。<Br>
先端には丸みを付け、生体への安全性にも配慮しています。<Br>
弾力がありますので、コオロギやミルワームを挟む時の手まで伝わる感触があり、使いやすいピンセットです。<Br><Br>
・全長：約280mm<Br>
・ステンレス製<Br>
・原産国：パキスタン<Br>
・原材料：SUS410（表面ウレタン塗膜）<Br>
<Br>
≪メンテナンス≫<Br>
・使用後は、水道水で水洗いをして、柔らかい布で水気を拭き取り、乾燥した場所に保管して下さい。<Br>
・軽度の汚れやシミには中性洗剤や石鹸水を布やスポンジに含ませ、その後、水洗いや水拭きをして最後に乾いた柔らかい布で拭いて下さい。<Br>
※長期間使用していると表面の黒いウレタン塗膜が剥がれる事があります。<Br><Br>

<!-- 生餌用品のおススメ商品一覧 -->



